import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';

function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary">
      {'Copyright © '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

export default function Footer() {
  return (
  <>  <Box position="relative"

  sx={{ zIndex: (theme) => theme.zIndex.drawer +1,
    textAlign: 'center',
    py: 3,
    px: 2,

    backgroundColor: " #005C9E",
  }}
>
        <Container maxWidth="xl" sx={{ zIndex: (theme) => theme.zIndex.drawer +1,
    textAlign: 'center',
    backgroundColor: "#005C9E",


  }}  >
          <Typography variant="h5" color="white" >
            สำนักงานใหญ่ประกันสังคม งานประกันสังคม สำนักงานใหญ่
          </Typography>
          <Typography variant="body1" color="white" >
            เลขที่ 88/8 หมู่ 4 ถนนติวานนท์ ตำบลตลาดขวัญ อำเภอเมือง จังหวัดนนทบุรี รหัสไปษณีย์ 11000
          </Typography>

        </Container>
     </Box>
      <Box position="relative"

      sx={{ zIndex: (theme) => theme.zIndex.drawer +1,
        textAlign: 'center',


        backgroundColor: " #005C9E",
      }}
    >
            <Container maxWidth="xl" sx={{ zIndex: (theme) => theme.zIndex.drawer +1,
        textAlign: 'center',
        backgroundColor: "#005C9E",


      }}  >
              <Typography variant="h5" color="white" >
                สำนักงานใหญ่ประกันสังคม งานประกันสังคม สำนักงานใหญ่
              </Typography>


            </Container>
         </Box></>
  );
}
